                // Note: spread existing config FIRST so our mobile overrides win.
                spec.config.legend = {
                    ...(spec.config.legend || {}),
                    orient: 'bottom',
                    direction: 'horizontal',
                    columns: 2,
                    labelLimit: 120,
                    labelFontSize: 12,
                    symbolSize: 120,
                    padding: 6,
                };
                spec.config.title = {
                    ...(spec.config.title || {}),
                    fontSize: 14,
                    subtitleFontSize: 11,
                    offset: 10,
                };
                spec.config.axis = {
                    ...(spec.config.axis || {}),
                    titleFontSize: 13,
                    labelFontSize: 12,
                    titlePadding: 10,
                    labelPadding: 4,
                };

                // Force legend placement on the encoding itself (more reliable than config alone).
                const legendOverride = {
                    orient: 'bottom',
                    direction: 'horizontal',
                    columns: 2,
                    labelLimit: 120,
                    labelFontSize: 12,
                    symbolSize: 120,
                    padding: 6,
                    title: 'Series',
                };
                const applyLegend = (node) => {
                    if (!node || typeof node !== 'object') return;
                    if (node.encoding && node.encoding.color) {
                        node.encoding.color.legend = { ...(node.encoding.color.legend || {}), ...legendOverride };
                    }
                    if (Array.isArray(node.layer)) {
                        for (const child of node.layer) applyLegend(child);
                    }
                    if (node.spec) applyLegend(node.spec);
                    if (Array.isArray(node.hconcat)) {
                        for (const child of node.hconcat) applyLegend(child);
                    }
                    if (Array.isArray(node.vconcat)) {
                        for (const child of node.vconcat) applyLegend(child);
                    }
                    if (Array.isArray(node.concat)) {
                        for (const child of node.concat) applyLegend(child);
                    }
                };
                applyLegend(spec);

                // More internal padding so title/subtitle and x-axis title aren't clipped.
                spec.padding = { top: 56, left: 10, right: 10, bottom: 70, ...(spec.padding || {}) };

                // Simplify the x-axis title on mobile.
                if (Array.isArray(spec.layer)) {
                    for (const lyr of spec.layer) {
                        if (lyr && lyr.encoding && lyr.encoding.x) {
                            lyr.encoding.x.title = 'Vintage Month';
                        }
                    }
                } else if (spec.encoding && spec.encoding.x) {
                    spec.encoding.x.title = 'Vintage Month';
                }

                // Keep title/subtitle short on mobile to reduce clipping.
                if (spec.title) {
                    if (typeof spec.title === 'string') {
                        spec.title = spec.title.replace('Delinquency', 'DQ');
                    } else {
                        if (spec.title.text) {
                            if (Array.isArray(spec.title.text)) {
                                spec.title.text = spec.title.text.map((t) => String(t).replace('Delinquency', 'DQ'));
                            } else {
                                spec.title.text = String(spec.title.text).replace('Delinquency', 'DQ');
                            }
                        }
                        // Mobile: keep subtitle short (touch users don't have Shift-click).
                        spec.title.subtitle = 'Use Bucket control; tap legend to toggle series.';
                    }
                }

                // Make legend selection multi-toggle work on touch (no Shift key).
                if (Array.isArray(spec.params)) {
                    for (const p of spec.params) {
                        if (p && p.name === 'Series' && p.select) {
                            p.select.toggle = 'true';
                            p.select.clear = false;
                        }
                    }
                }
            }
        } catch (e) {
            // Non-fatal: fall back to desktop spec
            console.warn('Mobile spec tweak failed', e);
        }

        try {
            const isSmall = window.matchMedia && window.matchMedia('(max-width: 640px)').matches;
            const isTouch = (
                (window.matchMedia && window.matchMedia('(pointer: coarse)').matches) ||
                (window.matchMedia && window.matchMedia('(any-pointer: coarse)').matches) ||
                (navigator && (navigator.maxTouchPoints || 0) > 0)
            );
            const isMobile = Boolean(isSmall && isTouch);
            const embedOptions = {actions: false, renderer: (isMobile ? 'svg' : 'canvas')};
            vegaEmbed('#vis', spec, embedOptions)
                .then(() => { if (statusEl) statusEl.style.display = 'none'; })
                .catch((err) => {
                    console.error('Vega embed failed', err);
                    if (statusEl) {
                        statusEl.style.display = 'block';
                        statusEl.innerHTML = '<b>Chart failed to render.</b><br/><pre>' + (err && (err.stack || err.message) ? (err.stack || err.message) : String(err)) + '</pre>';
                    }
                    if (visEl) visEl.innerHTML = '';
                });
        } catch (err) {
            console.error('Unexpected error', err);
            if (statusEl) {
                statusEl.style.display = 'block';
                statusEl.innerHTML = '<b>Unexpected error.</b><br/><pre>' + (err && (err.stack || err.message) ? (err.stack || err.message) : String(err)) + '</pre>';
            }
        }
  </script>
</body>
</html>
